import jsPDF from 'jspdf'; // Asegúrate de que jsPDF esté importado
  
  
 export const logoBase64 = 'data:image/png;base64,'; // Asegúrate de usar el código correcto




 export const generarCotizacion = (cotizacion) => {
    // Crear el documento PDF
    const doc = new jsPDF();
  
    // Ajusta el tamaño de la fuente para el título
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(18); // Aumentar el tamaño de la fuente del título
  
    // Agregar el logo en la parte superior
    doc.addImage(logoBase64, 'PNG', 10, 10, 30, 30); // Usando el logo importado
  
    // Agregar un espacio después del logo (ajusta este valor según lo que necesites)
    let verticalOffset = 60; // Aquí ajustamos el desplazamiento
  
    // Calcular el ancho del texto para centrarlo
    const title = 'Cotización de Vehículo';
    const titleWidth = doc.getTextWidth(title);
    const pageWidth = doc.internal.pageSize.getWidth();
    const xPosition = (pageWidth - titleWidth) / 2; // Calcular la posición horizontal para centrar
  
    // Agregar el título al PDF
    doc.text(title, xPosition, verticalOffset); // Título centrado
    verticalOffset += 20; // Incrementar el desplazamiento para los siguientes datos
  
    // Agregar la línea de validez
    const validityMessage = 'Esta cotización solo es válida por 15 días a partir de su fecha de emisión';
    doc.setFontSize(10); // Tamaño de fuente más pequeño para el mensaje
    doc.text(validityMessage, 20, verticalOffset);
    verticalOffset += 15; // Incrementamos para que no se solape con la siguiente línea
  
    // Cambiar el tamaño de la fuente para el resto del contenido
    doc.setFontSize(12); // Tamaño de fuente normal para el resto del texto
  
    // Agregar los datos de la cotización
    doc.text(`Nombre: ${cotizacion.nombre}`, 20, verticalOffset);
    verticalOffset += 10;
  
    doc.text(`RUT: ${cotizacion.rut}`, 20, verticalOffset);
    verticalOffset += 10;
  
    doc.text(`Fecha: ${cotizacion.fecha}`, 20, verticalOffset);
    verticalOffset += 10;
  
    doc.text(`Precio: $${cotizacion.precio}`, 20, verticalOffset);
    verticalOffset += 10;
  
    doc.text(`Descripción: ${cotizacion.descripcion}`, 20, verticalOffset);
    verticalOffset += 10;
  
    doc.text(`Tipo de Vehículo: ${cotizacion.tipoVehiculo}`, 20, verticalOffset);
  
    // Descargar el PDF
    doc.save(`${cotizacion.nombre}_cotizacion.pdf`);
  };
  